import React, { useState, useEffect } from 'react';
import {
  Box,
  Typography,
  Paper,
  Divider,
  List,
  ListItem,
  ListItemText,
  CircularProgress
} from '@mui/material';
import Alert from '@mui/material/Alert';
import api from '../../services/api';

/**
 * Компонент для отображения результатов анализа данных
 *
 * @param {Object} props
 * @param {number} props.fileId - ID файла для анализа
 * @param {string} props.analysisType - Тип анализа (trends, competitors, metrics)
 */
const AnalyticsDisplay = ({ fileId, analysisType = 'trends' }) => {
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [analysisData, setAnalysisData] = useState(null);

  useEffect(() => {
    const fetchAnalysisData = async () => {
      if (!fileId) return;
      setLoading(true);
      setError(null);

      try {
        console.log(`Запрос данных анализа: /analytics/file/${fileId}`);
        const response = await api.get(`/analytics/file/${fileId}`, {
          params: { analysis_type: analysisType }
        });
        console.log('Получен ответ от API:', response);

        if (response.data && response.data.result) {
          setAnalysisData(response.data.result);
        } else {
          console.error('Неверный формат ответа от сервера');
          setError('Неверный ответ от сервера');
        }
      } catch (err) {
        console.error('Ошибка при получении данных анализа:', err);
        setError('Ошибка при получении данных анализа');
      } finally {
        setLoading(false);
      }
    };

    fetchAnalysisData();
  }, [fileId, analysisType]);

  if (loading && !analysisData) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="200px">
        <CircularProgress />
      </Box>
    );
  }

  if (error && !analysisData) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="200px">
        <Typography color="error">{error}</Typography>
      </Box>
    );
  }

  if (!analysisData) {
    return (
      <Box display="flex" justifyContent="center" alignItems="center" minHeight="200px">
        <Typography>Анализ данных недоступен</Typography>
      </Box>
    );
  }

  return (
    <Box>
      {/* Анализ трендов */}
      <Paper elevation={2} sx={{ p: 3, mb: 3 }}>
        <Typography variant="h6" gutterBottom>
          Анализ трендов
        </Typography>
        <Divider sx={{ mb: 2 }} />
        {analysisData.trends_analysis ? (
          <Typography variant="body1" style={{ whiteSpace: 'pre-line' }}>
            {analysisData.trends_analysis}
          </Typography>
        ) : (
          <Typography variant="body2" color="textSecondary">
            Анализ трендов недоступен
          </Typography>
        )}
      </Paper>

      {/* Возможности */}
      <Paper elevation={2} sx={{ p: 3, mb: 3 }}>
        <Typography variant="h6" gutterBottom>
          Возможности
        </Typography>
        <Divider sx={{ mb: 2 }} />
        {analysisData.opportunities && analysisData.opportunities.length > 0 ? (
          <List>
            {analysisData.opportunities.map((item, index) => (
              <ListItem key={index}>
                <ListItemText primary={item} />
              </ListItem>
            ))}
          </List>
        ) : (
          <Typography variant="body2" color="textSecondary">
            Нет данных о возможностях
          </Typography>
        )}
      </Paper>

      {/* Угрозы */}
      <Paper elevation={2} sx={{ p: 3, mb: 3 }}>
        <Typography variant="h6" gutterBottom>
          Угрозы
        </Typography>
        <Divider sx={{ mb: 2 }} />
        {analysisData.threats && analysisData.threats.length > 0 ? (
          <List>
            {analysisData.threats.map((item, index) => (
              <ListItem key={index}>
                <ListItemText primary={item} />
              </ListItem>
            ))}
          </List>
        ) : (
          <Typography variant="body2" color="textSecondary">
            Нет данных об угрозах
          </Typography>
        )}
      </Paper>

      {/* Рекомендации */}
      <Paper elevation={2} sx={{ p: 3, mb: 3 }}>
        <Typography variant="h6" gutterBottom>
          Рекомендации
        </Typography>
        <Divider sx={{ mb: 2 }} />
        {analysisData.recommendations && analysisData.recommendations.length > 0 ? (
          <List>
            {analysisData.recommendations.map((item, index) => (
              <ListItem key={index}>
                <ListItemText primary={item} />
              </ListItem>
            ))}
          </List>
        ) : (
          <Typography variant="body2" color="textSecondary">
            Нет рекомендаций
          </Typography>
        )}
      </Paper>
    </Box>
  );
};

export default AnalyticsDisplay;
